import React, { useState, useEffect } from "react";
import {
  Box,
  Button,
  Typography,
  List,
  ListItem,
  Grid,
  IconButton,
  Chip,
  Paper,
} from "@mui/material";
import CheckIcon from "@mui/icons-material/Check";
import EditIcon from "@mui/icons-material/Edit";
import DeleteIcon from "@mui/icons-material/Delete";
import { useSnackbar } from "notistack";

// Helper functions to load/save data from localStorage
const loadFromLocalStorage = (key) => {
  const data = localStorage.getItem(key);
  return data ? JSON.parse(data) : {};
};

const saveToLocalStorage = (key, data) => {
  localStorage.setItem(key, JSON.stringify(data));
};

const StatusDebtor = () => {
  const { enqueueSnackbar } = useSnackbar();
  const [debts, setDebts] = useState(loadFromLocalStorage("debts"));

  useEffect(() => {
    saveToLocalStorage("debts", debts);
  }, [debts]);

  const handleMarkAsPaid = (participant) => {
    const updatedDebts = { ...debts };
    delete updatedDebts[participant];
    setDebts(updatedDebts);
    enqueueSnackbar(`${participant} has been marked as paid!`, {
      variant: "success",
    });
  };

  const handleEditDebt = (participant) => {
    const newAmount = prompt(
      `Enter new amount owed for ${participant}:`,
      debts[participant]
    );
    if (newAmount) {
      const updatedDebts = {
        ...debts,
        [participant]: parseFloat(newAmount).toFixed(2),
      };
      setDebts(updatedDebts);
      enqueueSnackbar(`Amount for ${participant} updated!`, {
        variant: "info",
      });
    }
  };

  const handleRemoveDebt = (participant) => {
    const updatedDebts = { ...debts };
    delete updatedDebts[participant];
    setDebts(updatedDebts);
    enqueueSnackbar(`${participant}'s debt has been removed!`, {
      variant: "warning",
    });
  };

  return (
    <Box
      p={3}
      sx={{ backgroundColor: "#f9f9f9", borderRadius: 2, boxShadow: 3 }}
    >
      <Typography variant="h4" align="center" gutterBottom color="primary">
        Status Debtor
      </Typography>

      {Object.keys(debts).length > 0 ? (
        <Paper
          elevation={3}
          sx={{ p: 2, mb: 3, borderRadius: 2, boxShadow: 5 }}
        >
          <List>
            {Object.keys(debts).map((participant) => (
              <ListItem key={participant} sx={{ mb: 2 }}>
                <Grid container spacing={2} alignItems="center">
                  <Grid item xs={4}>
                    <Typography variant="body1" sx={{ fontWeight: "bold" }}>
                      {participant}
                    </Typography>
                  </Grid>
                  <Grid item xs={4}>
                    <Typography variant="body1" color="secondary">
                      {debts[participant]} ฿
                    </Typography>
                  </Grid>
                  <Grid item xs={4}>
                    <IconButton
                      color="success"
                      onClick={() => handleMarkAsPaid(participant)}
                    >
                      <CheckIcon />
                    </IconButton>
                    <IconButton
                      color="primary"
                      onClick={() => handleEditDebt(participant)}
                    >
                      <EditIcon />
                    </IconButton>
                    <IconButton
                      color="error"
                      onClick={() => handleRemoveDebt(participant)}
                    >
                      <DeleteIcon />
                    </IconButton>
                  </Grid>
                </Grid>
              </ListItem>
            ))}
          </List>
        </Paper>
      ) : (
        <Typography align="center" variant="h6" color="textSecondary">
          No debts to show.
        </Typography>
      )}

      <Button
        variant="contained"
        color="primary"
        fullWidth
        sx={{ mt: 3 }}
        onClick={() => {
          setDebts({});
          enqueueSnackbar("All debts cleared!", { variant: "info" });
        }}
      >
        Clear All Debts
      </Button>
    </Box>
  );
};

export default StatusDebtor;
